$(document).ready(function () {
    const readMoreBox = $(".js-readmore");
    const readMoreLink = ".js-readmore-link";

    readMoreBox.next("p").hide();
    readMoreBox.children().each(function () {
        if ($.trim($(this).html()).length) {
            readMoreBox.next("p").show();
        }
    });
    readMoreBox.on("hide.bs.collapse", function () {
        const link = $(this).next("p").find(readMoreLink);
        link && link.html(link.data('showMoreLabel'));
    });
    readMoreBox.on("show.bs.collapse", function () {
        const link = $(this).next("p").find(readMoreLink);
        link && link.html(link.data('showLessLabel'));
    });

    const filterBox = $("#filter-collapse");
    const filterLink = ".btn-filters";

    filterBox.on("hide.bs.collapse", function () {
        const link = $(this).find(filterLink);
        link && link.html('See filters');
    });
    filterBox.on("show.bs.collapse", function () {
        const link = $(this).find(filterLink);
        link && link.html('Hide filters');
    });
});

