const COOKIE_FUNCTIONAL = "functionalCookieAccepted";
const COOKIE_ANALYTICAL = "analyticsCookieAccepted";
const COOKIE_ADVERTISING = "advertisingCookieAccepted";
const COOKIE_OTHERS = "othersCookieAccepted";
const COOKIE_LANGUAGE = "preferred-language";
const COOKIE_SITE_LANGUAGE = "l";

const BANNER_MODAL = "#cookieBannerModal";
const BANNER_INFO = "#cookieInfo";
const BANNER_SETTINGS = "#cookieSettings";

const BANNER_ACCEPT_BTN = "#cookieAcceptBtn";
const BANNER_ADJUST_BTN = "#cookieAdjustBtn";
const BANNER_MODIFY_BTN = "#cookieModifyBtn";
const BANNER_SAVE_BTN = "#cookieSaveBtn";
const BANNER_RETURN_BTN = "#cookieReturnBtn";

const INPUT_FUNCTIONAL = "functionalCookies";
const INPUT_ANALYTICAL = "analyticalCookies";
const INPUT_ADVERTISING = "advertisingCookies";
const INPUT_OTHERS = "followupCookies";
const INPUT_LANGUAGE = "#cookieLanguage";

const isAuthor = (getCookie("wcmmode") === "edit" || getCookie("wcmmode") === "design");

let activeLanguage = "";

$(document).ready(function () {
    if ($(BANNER_MODAL)[0] && !isAuthor) {
        const cookiePreferences = getCookie(COOKIE_FUNCTIONAL);

        $(INPUT_LANGUAGE).ready(function() {
            $(BANNER_INFO + " > [data-language]").slice(1).hide();

            $(document).on("change", INPUT_LANGUAGE, function() {
                $(BANNER_INFO + " > [data-language]").hide();
                $(BANNER_INFO + " > [data-language='" + $(this).val() + "']").show();
                activeLanguage = $(this).val();
            });
        });

        if (cookiePreferences === "") {
            $(BANNER_MODAL).modal("show");
        } else {
            if (getCookie(COOKIE_ANALYTICAL) === "true") {
                getCheckbox(INPUT_ANALYTICAL, "").prop("checked", true);
            }
            if (getCookie(COOKIE_ADVERTISING) === "true") {
                getCheckbox(INPUT_ADVERTISING, "").prop("checked", true);
            }
            if (getCookie(COOKIE_OTHERS) === "true") {
                getCheckbox(INPUT_OTHERS, "").prop("checked", true);
            }
        }
    } else {
        const bodyHome = $('body').data('homepage');
        const bodyLang = $('body').data('language');
        setLanguagePreference(bodyHome || "");
        setSiteLanguage(bodyLang || "");
    }

    $(document).on("click", BANNER_ACCEPT_BTN, function () {
        const cookieLang = $(INPUT_LANGUAGE).find(':selected').data('lang');
        const redirectLang = $(INPUT_LANGUAGE).val();
        const bodyHome = $('body').data('homepage');
        const bodyLang = $('body').data('language');

        setLanguagePreference(cookieLang || redirectLang || bodyHome);
        setSiteLanguage(bodyLang || "");
        setCookiePreferences(true, true, true);
        pushDatalayer(true, true, true);

        checkLanguage(redirectLang || bodyHome);
        $(BANNER_MODAL).modal('hide');
    });

    $(document).on("click", BANNER_ADJUST_BTN, function () {
        $(BANNER_INFO).addClass('cookie-banner--adjust');
    });

    $(document).on("click", BANNER_MODIFY_BTN, function () {
        $(BANNER_INFO).addClass('cookie-banner--adjust');
        $(BANNER_RETURN_BTN).hide();
        $(BANNER_MODAL).modal('show');
    });

    $(document).on("click", BANNER_SAVE_BTN, function () {
        const cookieLang = $(INPUT_LANGUAGE).find(':selected').data('lang');
        const redirectLang = $(INPUT_LANGUAGE).val();
        const bodyHome = $('body').data('homepage');
        const bodyLang = $('body').data('language');

        if (activeLanguage === "") activeLanguage = cookieLang || redirectLang || bodyHome;

        const analytics = getCheckbox(INPUT_ANALYTICAL, activeLanguage).is(":checked");
        const advertising = getCheckbox(INPUT_ADVERTISING, activeLanguage).is(":checked");
        const others = getCheckbox(INPUT_OTHERS, activeLanguage).is(":checked");

        setLanguagePreference(activeLanguage);
        setSiteLanguage(bodyLang || "");
        setCookiePreferences(analytics, advertising, others);
        pushDatalayer(analytics, advertising, others);

        if (!$(this).hasClass('modify')) {
            checkLanguage(redirectLang || bodyHome);
        }
        $(BANNER_MODAL).modal('hide');
    });

    $(document).on("click", BANNER_RETURN_BTN, function () {
        $(BANNER_INFO).removeClass('cookie-banner--adjust');
    });
});

function getCheckbox(id, lang) {
    return $("[id^=" + id + "-" + lang.replace("/", "").toLowerCase() + "]");
}

function checkLanguage(redirectLang) {
    const baseUrl = $(location).attr('origin');
    const path = $(location).attr('pathname');
    const redirect = (redirectLang.indexOf("/", 0) === 0) ? redirectLang : "/" + redirectLang;
    if (!path.includes(redirect)) {
        const pathPos = path.indexOf("/", path.indexOf("/") + 1);
        const link = window.document.createElement("a");
        link.setAttribute("href", baseUrl + redirect + (pathPos > -1 ? path.substr(pathPos) : ""));
        window.$("body").append(link);
        link.click();
    }
}

function pushDatalayer(analytics, advertising, others) {
    if (window.dataLayer) {
        window.dataLayer.push({
            'event': 'cookieConsentAccept',
            'cookieConsent': {
                'functionalCookieAccepted': true,
                'analyticsCookieAccepted': analytics,
                'advertisingCookieAccepted': advertising,
                'othersCookieAccepted': others
            }
        });
    }
}

function setCookiePreferences(analytics, advertising, others) {
    setCookie(COOKIE_FUNCTIONAL, true);
    setCookie(COOKIE_ANALYTICAL, analytics);
    setCookie(COOKIE_ADVERTISING, advertising);
    setCookie(COOKIE_OTHERS, others);
}

function setLanguagePreference(language) {
    setCookie(COOKIE_LANGUAGE, (language.indexOf("/", 0) === 0) ? language : "/" + language);
}

function setSiteLanguage(language) {
    setCookie(COOKIE_SITE_LANGUAGE, language.replace("/", ""));
}

