const GEO_BANNER = "#geolocation_banner";
const GEO_WRAPPER = "#geolocation_wrapper";
const GEO_BANNER_BTN = "#geolocation_btn";
const COOKIE_GEO_HIDDEN = "geoLocationHidden";
const SESSION_COUNTRY = "visitorCountry";
let latitude;
let longitude;

$(document).ready(function () {
    if ($(GEO_BANNER)[0] && !getCookie(COOKIE_GEO_HIDDEN) && !isAuthor) {
        const country = localStorage.getItem(SESSION_COUNTRY);

        if (country && country.length > 0) {
            includeBanner(country);
        } else {
            $(GEO_BANNER).ready(function () {
                if (navigator.geolocation) {
                    navigator.geolocation.getCurrentPosition(queryMaps);
                } else {
                    console.debug("Geolocation is not supported by this browser!");
                }
            });
        }
    }

    $(document).on("click", GEO_BANNER_BTN, function () {
        $(GEO_BANNER).hide();
        setCookie(COOKIE_GEO_HIDDEN, true);
    });
});

function queryMaps(position) {
    latitude = position.coords.latitude || null;
    longitude = position.coords.longitude || null;

    $.when(
        $.getScript("https://maps.googleapis.com/maps/api/js?key=AIzaSyDQoHVkd8uj7njzwtkajwa2dLIqsrKCzZE&callback=retrieveCountry")
    ).done(function (script, textStatus) {
    }).fail(function (jqxhr, settings, exception) {
        console.debug("Could not load Google Maps API!");
    });
}

function retrieveCountry() {
    const geocoder = new google.maps.Geocoder();
    const latlng = {
        lat: latitude,
        lng: longitude,
    };

    geocoder.geocode({location: latlng}, (results, status) => {
        if (status === "OK") {
            const address = results[0].address_components.filter(address => address['types'].includes('country'));
            const country = (address && address.length > 0 && address[0].short_name) || null;

            if (country != null) {
                localStorage.setItem(SESSION_COUNTRY, country);
                includeBanner(country);
            }
        } else {
            console.debug("Geolocation could not retrieve country!");
        }
    });
}

function includeBanner(country) {
    const path = window.location && window.location.origin;
    const homepage = $("body").data("homepage") || window.location.pathname.split("/")[1] || "";
    $(GEO_BANNER).load(path + homepage + '/header-and-footer/jcr:content/header/geolocation.' + country.toLowerCase() + '.html ' + GEO_WRAPPER);
}

