class MiniFinder {

    constructor(finder) {
        this.navigation = $(finder).find('.mini-finder__nav');
        this.firstNavItem = this.navigation.find('> div:first-child');
        this.backBtnMobile = $(finder).find('.mini-finder__nav > div > .return-arrow-xs');
        this.tabs = $(finder).find("[data-tab]");
        this.categories = $(finder).find("[data-category]");
        this.tags = $(finder).find("[data-tags]");
        this.tagsContainer = $(finder).find("[data-tag]");

        this.addEventListeners();
    }

    addEventListeners() {
        this.firstNavItem.on('click', null, this, this.handleNavigation);
        this.backBtnMobile.on('click', null, this, this.handleNavigation);
        this.categories.on('click', null, this, this.handleSelectCategory);
        this.tagsContainer.on('click', null, this, this.handleTagsContainer);
    }

    handleSelectCategory(event) {
        let finder = event.data;

        NavigationAction.checked(finder, 0);
        NavigationAction.active(finder, 1);

        ContentAction.open(finder, 2);

        TagsAction.show(finder, event.target.parentElement.getAttribute('data-category'));
        TagsContainerAction.open(finder, 0);
    }

    handleTagsContainer(event) {
        let finder = event.data;
        let index;

        if (event.target.getAttribute('data-tag') != null) {
            index = event.target.getAttribute('data-tag');
        } else {
            index = event.target.parentElement.getAttribute('data-tag');
        }

        finder.tags.each(function() {
            if ($(this).css('display') === 'block') {
                if ($(this).children().eq(index).hasClass('open')) {
                    TagsContainerAction.close(finder, index);
                } else {
                    TagsContainerAction.open(finder, index);
                }
            }
        });
    }

    handleNavigation(event) {
        let finder = event.data;

        NavigationAction.normal(finder,1);
        NavigationAction.active(finder,0);

        ContentAction.open(finder, 1);

        TagsAction.hideAll(finder);
        TagsContainerAction.closeAll(finder);
    }
}

class NavigationAction {

    static checked(finder, index) {
        let nav = $(finder.navigation).find('> div').eq(index);
        nav.removeClass('active');
        nav.addClass('checked');
    }

    static active(finder, index) {
        let nav = $(finder.navigation).find('> div').eq(index);
        nav.removeClass('checked');
        nav.addClass('active');
    }

    static normal(finder, index) {
        let nav = $(finder.navigation).find('> div').eq(index);
        nav.removeClass('active');
        nav.removeClass('checked');
    }

}

class ContentAction {

    static open(finder, index) {
        $(finder.tabs).each(function() {
            $(this).data('tab') === index ? $(this).css('display', 'flex') : $(this).css('display', 'none');
        });
    }

}

class TagsAction {

    static show(finder, index) {
        $(finder.tags).filter('[data-tags="'+index+'"]').css('display', 'block');
    }

    static hide(finder, index) {
        $(finder.tags).filter('[data-tags="'+index+'"]').css('display', 'none');
    }

    static hideAll(finder) {
        $(finder.tags).css('display', 'none');
    }

}

class TagsContainerAction {

    static open(finder, index) {
        $(finder.tags).each(function() {
            if ($(this).css('display') === 'block') {
                $(this).children().eq(index).addClass('open');
            }
        });
    }

    static close(finder, index) {
        $(finder.tags).each(function() {
            if ($(this).css('display') === 'block') {
                $(this).children().eq(index).removeClass('open');
            }
        });
    }

    static closeAll(finder) {
        $(finder.tags).each(function() {
            $(this).children().removeClass('open');
        });
    }

}

$('body').data('app', 'mini-finder').each(function() {
    new MiniFinder(this);
});

