const SHOW_MORE_BUTTON = 'show-more-button';
const SHOW_MORE_EQUAL_WIDTH = 'show-more-equal-width';

let wrappedElements = [];
let initializedTargets = [];

$(function () {
    // Pageload
    let $collapseItems = $('.collapse-items');
    collapseItemsReady($collapseItems);

    // Switch tabs
    $('.p-contact-content__tab-link').click(function () {
        const id = $(this).attr('href');
        const detailsContainer = $(this).closest('.p-contact-content').find(id);
        $collapseItems = $(detailsContainer).find('.collapse-items');
        if ($collapseItems) {
            collapseItemsReady($collapseItems);
        }
    });

    // Resize
    $(window).resize(function () {
        $collapseItems = $('.collapse-items');
        collapseItemsReady($collapseItems);
    });
});

const collapseItemsReady = function ($collapseItems) {
    $collapseItems.ready(function () {
        if ($collapseItems.length > 1) {
            for (const item of $collapseItems) {
                initializeItem(item);
            }

            return;
        }

        const item = $collapseItems[0];
        initializeItem(item)
    });
}

const breakItems = function ($items, targetId) {

    const parentWidth = $items.parent().width();
    const elements = $items.children();

    let $showMoreButton;
    wrappedElements = [];

    for (let i = 0; i < elements.length; i++) {
        const $element = $(elements[i]);

        if (!$element.hasClass(SHOW_MORE_BUTTON) && $element.is(":hidden")) $element.show();

        if ($element.attr('href') === targetId || $element.hasClass(SHOW_MORE_BUTTON)) {
            $showMoreButton = $element;
            continue;
        }

        const dir = $('html').attr('dir');
        dir === 'rtl' ? wrapRtl($element, elements, i) : wrapLtr($element, elements, i, parentWidth);
    }

    if (wrappedElements.length > 0) {
        $showMoreButton.show();
        $items.find('span.wrappedElementsLength').text(wrappedElements.length);
        $items.next(targetId).html(wrappedElements);
    }
};

const wrapRtl = function ($element, elements, i) {
    // Get x position of the end of the element
    const elementEndPosition = $element.position().left;

    if (elementEndPosition === 0) {
        return;
    }

    if (!$(elements[i + 1]).hasClass(SHOW_MORE_BUTTON)) {
        if (elementEndPosition - 40 < 0) {
            wrappedElements.push($element.clone());
            $element.hide();
        }
    } else {
        if (elementEndPosition < 0 || $(elements[i + 1]).hasClass(SHOW_MORE_EQUAL_WIDTH)) {
            wrappedElements.push($element.clone());
            $element.hide();
        }
    }
}

const wrapLtr = function ($element, elements, i, parentWidth) {
    if (parentWidth <= 0) {
        return;
    }

    // Get x position of the end of the element
    const elementEndPosition = $element.position().left + $element.width();

    if (!$(elements[i + 1]).hasClass(SHOW_MORE_BUTTON)) {
        if (elementEndPosition + 40 > parentWidth) {
            wrappedElements.push($element.clone());
            $element.hide();
        }
    } else {
        if (wrappedElements.length > 0 && elementEndPosition + 40 > parentWidth) {
            wrappedElements.push($element.clone());
            $element.hide();
        } else if (elementEndPosition > parentWidth) {
            wrappedElements.push($element.clone());
            $element.hide();
        }
    }
}

const initializeItem = function(item) {
    const targetId = $(item).find('.show-more-button').attr('href') || $(item).find('.show-more-button').find('a').attr('href');
    initializeCollapseListeners(targetId, $(item), $(item).find('.' + SHOW_MORE_BUTTON), $(item).siblings('.p-link-small'));
    if ($(targetId).attr('aria-expanded')) {
        $(targetId).collapse('hide');
    }

    breakItems($(item), targetId);
}

const initializeCollapseListeners = function (targetId, $items, $showMoreButton, $showLessButton) {
    if (initializedTargets.includes(targetId)) {
        return;
    }

    initializedTargets.push(targetId);

    $(targetId).on('show.bs.collapse', function () {
        // If the items are equal width, we can fit one more onto this line instead of the show-more button
        if ($showMoreButton.hasClass(SHOW_MORE_EQUAL_WIDTH)) {
            let newElements = $items.children();

            // Replace show-more button by first value of wrapped elements and remove it from wrappedElements
            newElements = newElements.add(wrappedElements[0]);
            wrappedElements.shift();

            // Update html of main items and of wrappedItems
            $items.html(newElements);
            $items.next(targetId).html(wrappedElements);
        }

        $showMoreButton.hide();
        $showLessButton.show();
        $items.parent().css('flex-wrap', 'wrap');

        if ($items.find('[data-toggle="tooltip"]')) {
            initTooltips();
        }
    });

    $(targetId).on('hide.bs.collapse', function () {
        if ($showMoreButton.hasClass(SHOW_MORE_EQUAL_WIDTH)) {
            let newElements = $items.children();
            const lastItem = newElements[newElements.length - 1];
            wrappedElements = $items.next(targetId).children().toArray();

            // Replace last items by view more button and add it to wrappedElements
            newElements.splice(-1);
            wrappedElements.unshift(lastItem);

            // Update html of main items and of wrappedItems
            $items.html(newElements);
            $items.next(targetId).html(wrappedElements);
        }

        $items.parent().attr('style', '');
        $showLessButton.hide();
        $showMoreButton.show();

        if ($items.find('[data-toggle="tooltip"]')) {
            initTooltips();
        }
    });
}

