$(document).ready(function () {
    // Use variables of responsive as a constant
    var responsiveness = [
        {
            breakpoint: 1200,
            settings: {
                slidesToShow: 3,
                slidesToScroll: 3
            }
        }, {
            breakpoint: 760,
            settings: {
                slidesToShow: 2,
                slidesToScroll: 2
            }
        }, {
            breakpoint: 600,
            settings: {
                slidesToShow: 1,
                slidesToScroll: 1
            }
        }
    ];

    $('.js-slick').each(function () {
        var thumbs = $(this).data('slick-thumbs');
        var arrows = $(this).data('slick-arrows');

        if (thumbs) {
            $(this).not('.slick-initialized').slick({
                arrows: arrows,
                asNavFor: $("#slider-nav[data-hashset='" + thumbs + "']"),
                speed: 300,
                slide: 'div:not(.cq-Editable-dom)',
                waitForAnimate: false,
            });
            $("#slider-nav[data-hashset='" + thumbs + "']").not('.slick-initialized').slick({
                slidesToShow: 4,
                slidesToScroll: 1,
                asNavFor: $(this),
                centerMode: false,
                arrows: false,
                focusOnSelect: true,
                speed: 300,
                waitForAnimate: false
            });
        } else {
            $(this).not('.slick-initialized').slick({
                arrows: arrows,
                responsive: responsiveness,
                speed: 300
            });
        }
    });

    $(window).on('breakpoint', function(event, _slick, breakpoint) {

        function debounce(func, wait, immediate) {
            var timeout;
            return function() {
                var context = this, args = arguments;
                var later = function() {
                    timeout = null;
                    if (!immediate) func.apply(context, args);
                };
                var callNow = immediate && !timeout;
                clearTimeout(timeout);
                timeout = setTimeout(later, wait);
                if (callNow) func.apply(context, args);
            };
        }

        var unslickify = debounce(function() {
            $('.js-slick').slick('unfilterSlides');
            $('.js-slick').slick('unslick');
        }, 250);

        if(breakpoint === 600) {
            unslickify();
        }
    });

    const $contentCardsSlick = $('.content-cards-js-slick');
    const breakpoint = 600;
    const responsivenessContentCards = [
        {
            breakpoint: breakpoint,
            settings: 'unslick'
        }
    ];

    const slick = function () {
        if ($contentCardsSlick && $contentCardsSlick.length) {
            $contentCardsSlick.slick({
                slidesToShow: 1,
                slidesToScroll: 1,
                arrows: true,
                mobileFirst: true,
                adaptiveHeight: true,
                responsive: responsivenessContentCards
            });
        }
    };

    slick();

    $(window).on('resize', function () {
        var width = $(window).width();
        if (width < breakpoint) {
            slick();
        }
    });

});

