var spinnerWrapper = $('.js-spinner');

function spinner() {
    $('.js-spinner-button').on('click', initSpinner);
    $(document).on('click', '.js-spinner-button', initSpinner);
    $(document).on('keydown', '.js-spinner .input-number', function(e) {
        if (e.key === '-' || /a-zA-Z/i.test(e.key)) {
            e.preventDefault();
        }
    });
    $(document).on('blur', '.js-spinner .input-number', function(e) {
        if (!isFinite($(this).val())) {
            $(this).val($(this).attr("min"))
        }
    });
}

function initSpinner() {
    var $button = $(this);

    var $input = $button.parent().find('input');
    var min = $input.attr("min") ? parseInt($input.attr("min")) : 1;
    var max = $input.attr("max") ? parseInt($input.attr("max")) : Number.MAX_SAFE_INTEGER;

    var oldValue = $button.parent().find('input').val();
    var newVal;
    if ($button.text() == '+') {
        if (oldValue == '') {
            oldValue = min;
        }

        if (oldValue < max) {
            newVal = parseFloat(oldValue) + 1;
        } else {
            newVal = oldValue;
        }
    }

    else {
        // Don't allow decrementing below zero
        if (oldValue > min) {
            newVal = parseFloat(oldValue) - 1;
        } else {
            newVal = min;
        }
    }

    $button.parent().find('input').val(newVal).trigger('change');
}

$(document).ready(function () {
    spinner();
});

