function reRenderTabs(root) {
    const tabLinks = ".p-contact-content__tab:not(.tabs__view-more)";
    const viewMoreTab = ".tabs__view-more";
    const viewMoreContainer = ".tabs__view-more-submenu";

    root.each(function () {
        $(this).find(viewMoreTab).css("display", "none", "important");
        $(this).find(tabLinks).removeClass("hide");
        $(this).find(viewMoreContainer).empty();
        tabsProductPageInit($(this));
    });
}

function tabsProductPageInit(root) {
    const tabsContainer = ".p-contact-content__tab-nav-container";
    const tabLinks = ".p-contact-content__tab";
    const viewMoreTab = ".tabs__view-more";
    const viewMoreContainer = ".tabs__view-more-submenu";
    const isDesktop = $(window).width() >= maxMobileViewport;

    handleTabsVisibility(root);

    root.find(viewMoreTab).off("click");
    root.find(viewMoreTab).click((e) => {
        e.preventDefault();
        $(e.target).next(viewMoreContainer).toggle();
    });

    const body = $("body");
    body.off("click");
    body.click((e) => {
        const elem = $(e.target).is("li") ? $(e.target) : $(e.target).parent();

        if (!(elem && elem.is("li") && elem.attr("class").indexOf(viewMoreTab.substring(1)) >= 0)) {
            $(viewMoreContainer).hide();
        }
    });

    const viewMoreContainerLinks = $(viewMoreContainer + " > " + tabLinks + " > a");
    const tabLinksLinks = $(tabsContainer + " > " + tabLinks + " > a");
    viewMoreContainerLinks.off("click");
    viewMoreContainerLinks.click((e) => {
        root.find(tabLinks).removeClass("active");

        tabLinksLinks.each(function() {
            if ($(e.target).attr('href') === $(this).attr('href')) {
                $(this).parent().addClass("active");
                !isDesktop && $(this).parent().prependTo(tabsContainer);
            }
        });

        root.find(viewMoreTab).css("display", "none", "important");
        root.find(tabLinks).removeClass("hide");
        root.find(viewMoreContainer).empty();
        tabsProductPageInit(root);
    });
}

function hideEmptyTabs(root) {
    let counter = 0;
    let initialized = false;

    root.find(".tab-content > .tab-pane").each(function () {
        const DOMCopy = $($(this)[0]).clone();
        DOMCopy.find("script").remove();
        DOMCopy.find(".modal").remove();

        const id = $(this).attr("id");

        if (!/([^\s])/.test(DOMCopy[0].innerText) &&
            DOMCopy[0].innerHTML.indexOf("google-maps-container") === -1 &&
            DOMCopy[0].innerHTML.indexOf("puratos-worldmap-embed") === -1 &&
            DOMCopy[0].innerHTML.indexOf("react-product--details") === -1
        ) {
            $(this).css("display", "none", "important");
            root.find("a[href='#" + id + "']").parent("li").css("display", "none", "important");
            root.find("a[href='#" + id + "']").parent("li").addClass("hide");
        } else {
            $(this).css("display", "", "important");
            root.find("a[href='#" + id + "']").parent("li").css("display", "", "important");
            root.find("a[href='#" + id + "']").parent("li").removeClass("hide");

            if (!initialized && counter === 0) {
                initialized = true;
                $(this).addClass("active");
                root.find("a[href='#" + id + "']").parent("li").addClass("active");
            }

            counter++;
        }
    });

    root.css("display", counter > 0 ? "" : "none");
}

function handleTabsVisibility(root) {
    const tabsContainer = root.find(".p-contact-content__tab-nav-container");
    const tabsContainerWidth = tabsContainer.innerWidth();
    const tabViewMore = tabsContainer.find($(".tabs__view-more"));
    const tabViewMoreSubmenu = tabViewMore.find($(".tabs__view-more-submenu"));
    const tabs = root.find(".p-contact-content__tab-nav-container > .p-contact-content__tab:visible:not(.tabs__view-more)");
    const tabActive = root.find(".p-contact-content__tab-nav-container > .p-contact-content__tab.active:visible:not(.tabs__view-more)").eq(0);
    const isDesktop = $(window).width() >= maxMobileViewport;

    tabViewMore.css("white-space", "nowrap");
    const tabViewMoreWidth = tabViewMore.outerWidth();
    tabViewMore.css("white-space", "normal");

    let tabsWidth = tabViewMoreWidth + 24;

    if (isDesktop && tabActive) {
        tabsWidth += tabActive.outerWidth();
    }

    tabs.each(function (i) {
        const tabWidth = $(this).outerWidth() || 0;
        const isTabActive = $(this).hasClass("active");
        const nextTabWidth = tabs.eq(i+1) && tabs.eq(i+1).outerWidth() || 0;

        if (!isDesktop || (!isTabActive && isDesktop)) {
            tabsWidth += tabWidth;
        }

        if (tabsWidth >= tabsContainerWidth && !(nextTabWidth === 0 && tabsWidth - tabViewMoreWidth < tabsContainerWidth) && i !== 0 && !(isDesktop && isTabActive)) {
            tabViewMoreSubmenu.append($(this).clone());
            tabViewMore.css("display", "inline-block", "important");
            $(this).addClass("hide");
        }
    });

}

