// ---
// Typeahead (https://github.com/twitter/typeahead.js)
// -
// Autocomplete for search fields
// ---

// Define all modules
var autocomplete = {
    init: function () {
        autocomplete.search.getSuggestJSON();
    }
};

// Initialize the modules
$(autocomplete.init);

// Search autocomplete
autocomplete.search = {
    init: function (suggestString) {
        var $jsTypeaheadSearch = $('.js-typeahead-search');
        $.each($jsTypeaheadSearch, function (index, value) {
            var searchPage = $(value).attr('data-search-page');
            var label = $(value).attr('data-links-label');

            var suggestions = new Bloodhound({
                name: 'suggest',
                // Custom datumTokenizer to allow single character searches
                datumTokenizer: function (d) {
                    var datum = Bloodhound.tokenizers.whitespace(d.title);
                    $.each(datum, function (k, v) {
                        i = 0;
                        while ((i + 1) < v.length) {
                            datum.push(v.substr(i, v.length));
                            i++;
                        }
                    });
                    return datum;
                },
                queryTokenizer: Bloodhound.tokenizers.whitespace,
                remote: {
                    url: "/services/suggest?term=%QUERY&path="
                    + searchPage,
                    filter: function (x) {
                        if (x)
                            return $.map(x, function (object) {
                                return {
                                    title: object.title,
                                    path: object.path,
                                    category: object.category,
                                    label: label
                                };
                            });
                        else return {};
                    },
                    wildcard: "%QUERY"
                }
            });
            autocomplete.search.handleBloodHoundInstances(suggestions, value);

        });

    },

    getSuggestJSON: function () {
        // retrieve the suggest list to add to the "local" or bloodhound
        var url = "/services/suggest";

        $.getJSON(url, function (data) {
            autocomplete.search.init(data);
            return data;
        });
    },

    handleBloodHoundInstances: function (bloodhound, value) {
        var label = $(value).attr('data-search-label');
        var allResultsLabel = $(value).attr('data-all-results-label');

        var dataSet = {
            name: 'suggest',
            display: 'title',
            source: bloodhound,
            limit: 100,
            templates: {
                suggestion: Handlebars.compile('<li><a href="{{path}}"><strong>{{title}}</strong>{{#if category}}<span class="text-muted">&nbsp;&hellip;&nbsp;' + label + '&nbsp;<span class="label label-default">{{category}}</span></span>{{/if}}</a></li>'),
                footer: allResultsLabel ? '<li><a href="#" class="tt-show-all">&plus;&nbsp;' + allResultsLabel + '</a></li>' : false
            }
        };

        $(".cap-search-autocomplete").on('click', '.tt-show-all', function (e) {
            e.preventDefault();
            $(e.currentTarget).parents("form").submit();
        });

        $(".p-navbar-mobile--footer").on('click', '.btn', function (e) {
            e.preventDefault();
            $(e.currentTarget).closest('div').parent().find('form').submit();
        });

        $(value).typeahead({
            hint: true,
            highlight: true,
            minLength: 2
        }, dataSet)
            .on("typeahead:selected", function (e, datum) {
                if (datum.path) {
                    // makes the autocomplete go to the link
                    e.preventDefault();
                }
                else {
                    // text gets added to the input and automatically submits form after selecting it.
                    $(e.currentTarget).val(datum.label);
                    $(e.currentTarget).parents("form").submit();
                }
            });
    }
};


