const FavoriteRecipeApi = {

    init: function () {
        var roleCookie = getCookie("r");
        if (roleCookie) {
            $.when(FavoriteRecipeApi.fetch()).then(FavoriteRecipeApi.highlight);
        } else {
            FavoriteRecipeApi.highlight();
        }
        FavoriteRecipeApi.attachEventHandlers()
    },

    fetch: function () {
        return $.ajax({
            url: "/rest/recipe/favorite",
            type: 'GET',
            xhrFields: {
                withCredentials: true,
            }
        })
    },

    updateCache: function (data) {
        sessionStorage.favoriteRecipes = JSON.stringify(data.data);
    },

    highlight: function (data) {
        if (data) {
            FavoriteRecipeApi.updateCache(data);
        }
        const $recipeIds = $('a[data-recipe-id]');
        if ($recipeIds) {
            const favoritedRecipes = sessionStorage.favoriteRecipes;
            if (favoritedRecipes) {
                $recipeIds.each(function (index, value) {
                    const $value = $(value);
                    const $label = $value.find('span');
                    if (favoritedRecipes.indexOf($value.data('recipeId')) !== -1) {
                        if ($label.hasClass('glyphicon-heart-empty')) {
                            $label.removeClass('glyphicon-heart-empty');
                            $label.addClass('glyphicon-heart');
                        }
                    } else {
                        if ($label.hasClass('glyphicon-heart')) {
                            $label.removeClass('glyphicon-heart');
                            $label.addClass('glyphicon-heart-empty');
                        }
                    }
                });
            }
        }
    },

    attachEventHandlers: function () {
        $('.js-favorite-recipe').on('click', function (e) {
            if (!MyPuratosACL.isLoggedIn()) {
                const loginUrl = $('body').data('loginurl');
                if (loginUrl) {
                    window.location.href = loginUrl;
                }
            }
            else {
                const $this = $(this);
                const $label = $(this).find('span');
                $this.attr("disabled", true);
                const recipeId = $(this).data('recipeId');
                const recipeUrl = window.location.protocol + "//" + window.location.hostname + $(this).next().attr('href');
                $.ajax({
                    url: "/rest/recipe/toggle?recipe-id=" + recipeId + "&url=" + recipeUrl,
                    type: 'POST',
                    xhrFields: {
                        withCredentials: true,
                    }
                }).done(function (data) {
                    $this.attr("disabled", false);
                    if ($label.hasClass('glyphicon-heart-empty')) {
                        $label.removeClass('glyphicon-heart-empty');
                        $label.addClass('glyphicon-heart');
                    } else if ($label.hasClass('glyphicon-heart')) {
                        $label.removeClass('glyphicon-heart');
                        $label.addClass('glyphicon-heart-empty');
                    }
                    $.when(FavoriteRecipeApi.fetch()).then(FavoriteRecipeApi.updateCache);
                }).fail(function () {
                    $this.attr("disabled", false);
                    $label.removeClass('glyphicon-heart-empty');
                    $label.removeClass('glyphicon-heart');
                    $label.addClass('glyphicon-remove');
                });
            }
        });
    },
};

