const HOMEPAGE_ATTRIBUTE = "data-homepage";
const CURRENT_LANGUAGE_ATTRIBUTE = "data-active-lang";
const LANGUAGE_SWITCH_CLASS = ".p-navbar--language";
const $homePageCall = $('[' + HOMEPAGE_ATTRIBUTE + ']');


$(function () {
    checkPreferredLanguageCookie();
    bindLanguageListeners();
});

function checkPreferredLanguageCookie() {
    if (getCookie("wcmmode") !== "edit" && getCookie("wcmmode") !== "design") {
        const langCookie = getCookie(COOKIE_PREFERRED_LANGUAGE);
        if (langCookie && langCookie.length > 0) {
            let currentLang = $(LANGUAGE_SWITCH_CLASS).attr(CURRENT_LANGUAGE_ATTRIBUTE);
            if (currentLang) {
                currentLang = currentLang.toUpperCase();
            }
            if (currentLang !== langCookie.toUpperCase()) {
                if (isHomepage(currentLang)) {
                    const redirectUrl = getRedirectionUrl(langCookie);
                    if (redirectUrl) {
                        window.location.href = redirectUrl;
                    }
                }
            }
        }
    }
}

function isHomepage(language) {
    if ($homePageCall.length) {
        return $homePageCall.attr(HOMEPAGE_ATTRIBUTE) === "true";
    }

    return language && (language.toLowerCase() === window.location.pathname.toLowerCase() || language.toLowerCase() + ".html" === window.location.pathname.toLowerCase());
}

function bindLanguageListeners() {
    $(LANGUAGE_SWITCH_CLASS + ' a[' + LANGUAGE_ATTRIBUTE + ']').on('click', function (event) {
        event.preventDefault();
        const langCode = $(this).attr(LANGUAGE_ATTRIBUTE);
        const lCookie = getCookie("l");
        const langCountry = $(this).attr(LANGUAGE_COUNTRY_ATTRIBUTE);
        if (lCookie && lCookie !== "" && langCountry && langCountry !== "") {
            setCookie("l", langCountry);
        }
        setCookie(COOKIE_PREFERRED_LANGUAGE, langCode.toLowerCase());
        window.location.href = $(this).attr('href');
    });
}

function getRedirectionUrl(lang) {
    if (lang) {
        return $(LANGUAGE_SWITCH_CLASS).find("a[" + LANGUAGE_ATTRIBUTE + "^='" + lang.toUpperCase() + "']").attr("href");
    }
}

