var MyPuratosACL = {
    ROLE_COOKIE_NAME: "r",
    IMPERSONATED_ROLE_COOKIE_NAME: "i_r",
    ACL_DATA_ATTRIBUTE: "data-acl",
    REMOVE_DATA_ATTRIBUTE: "data-remove",
    ACL_CALL_DATA_ATTRIBUTE: "data-acl-call",

    RoleMatrix: {
        puratosCustomerValidated: "be81f9162b0df0c3ec9b59ec6bf7d58e",
        puratosNewCustomer: "7057941d6c545e16d4f1be51b7358a48",
        puratosCustomerNoAuth: "fee4e4a6f6eadba7a5cd0a72aaf19045",
        puratosCustomerUnvalidated: "fe6109c434fe17a25e5de520e9ae088b",
        puratosNoCustomer: "37cbfff8a4e11c6307927055a62daf4d"
    },

    aclElements: [],
    roles: undefined,

    isLoggedIn: function () {
        const role = MyPuratosACL.getRole();

        return !role || role !== "customerLoggedOut";
    },

    isImpersonating: function () {
        var status = getCookie("i_s");

        return (status && status == "ACTIVE");
    },

    getRoles: function () {
        var roleCookie = getCookie(MyPuratosACL.isImpersonating() ? MyPuratosACL.IMPERSONATED_ROLE_COOKIE_NAME : MyPuratosACL.ROLE_COOKIE_NAME);
        if (roleCookie) {
            MyPuratosACL.roles = JSON.parse(roleCookie);
        }
    },
    init: function () {
        MyPuratosACL.processRemove();
        MyPuratosACL.aclElements = $("[" + MyPuratosACL.ACL_DATA_ATTRIBUTE + "]");
        MyPuratosACL.getRoles();
        if (MyPuratosACL.aclElements && MyPuratosACL.aclElements.length > 0) {
            MyPuratosACL.aclElements.each(function (k, aclElement) {
                MyPuratosACL.processVisibility(aclElement);
            });
        }

        // Compatibility fix
        if (login !== undefined) {
            login = MyPuratosACL.isLoggedIn();
        }
    },
    processVisibility: function (element) {
        if (element) {
            var aclElement = $(element);
            var roleInfo = aclElement.attr(MyPuratosACL.ACL_DATA_ATTRIBUTE);
            if (roleInfo) {
                var parsedRoles = roleInfo.split(",");
                if (MyPuratosACL.hasRole(parsedRoles) || (parsedRoles.indexOf("none") !== -1 && (!MyPuratosACL.roles || MyPuratosACL.roles.length === 0))) {
                    aclElement.addClass("acl-allowed");
                    var fnCall = aclElement.attr(MyPuratosACL.ACL_CALL_DATA_ATTRIBUTE);
                    MyPuratosACL.callFunction(fnCall, aclElement);
                }
            }
        }
    },
    processRemove: function () {
        $('[' + MyPuratosACL.REMOVE_DATA_ATTRIBUTE + '="true"]').remove();
    }
    ,
    callFunction: function (fnName, element) {
        if (fnName) {
            var fn;
            // When the function contains a dot (Util class)
            if (fnName.indexOf(".") !== -1) {
                var fns = fnName.split(".");
                if (fns.length > 1) {
                    fn = window[fns[0]];
                    for (var i = 1; i < fns.length; i++) {
                        if (fn) {
                            fn = fn[fns[i]];
                        }
                    }
                }
            } else {
                fn = window[fnName];
            }

            if (typeof fn === 'function') {
                fn(element);
            }
        }
    },
    hasRole: function (qRoles) {
        let role = MyPuratosACL.getRole();
        let roleId = MyPuratosACL.RoleMatrix[role];

        if (role === "puratosNewCustomer") {
            if (Array.isArray(qRoles)) {
                if(qRoles.indexOf("puratosCustomerValidated") !== -1 || qRoles.indexOf(MyPuratosACL.RoleMatrix.puratosCustomerValidated) !== -1) {
                    return true;
                }
            } else if ("puratosCustomerValidated" === qRoles || MyPuratosACL.RoleMatrix.puratosCustomerValidated === qRoles) {
                return true;
            }
        }

        if (Array.isArray(qRoles)) {
            return qRoles.indexOf(role) !== -1 || qRoles.indexOf(roleId) !== -1;
        } else {
            return role === qRoles || roleId === qRoles;
        }
    },
    getRole: function () {
        if (!MyPuratosACL.roles) {
            MyPuratosACL.getRoles();
        }

        if (!MyPuratosACL.roles) {
            return "customerLoggedOut";
        }

        var roles = Array.isArray(MyPuratosACL.roles) ? MyPuratosACL.roles : Object.keys(MyPuratosACL.roles);

        if (!roles || roles.length === 0) {
            return "customerLoggedOut";
        }

        var role = roles[0];

        for (var k in MyPuratosACL.RoleMatrix) {
            if (MyPuratosACL.RoleMatrix.hasOwnProperty(k) && MyPuratosACL.RoleMatrix[k] === role) {
                return k;
            }
        }

        return "customerLoggedOut";
    }

};



