var ProductCards = {
    CARDS_CLASS: ".cards",
    TABBED_CARDS_CLASS: ".tabbed-cards",
    ADD_TO_CART_MODAL_CLASS: ".product-cards-cart-modal",
    ADD_TO_CART_CLASS: ".product-finder-add-to-cart",
    init: function () {
        // Add to cart modal
        $(ProductCards.CARDS_CLASS + ", " + ProductCards.TABBED_CARDS_CLASS).on('click', ProductCards.ADD_TO_CART_MODAL_CLASS, ProductCards.handleAddToCartModal);
        // Add to cart
        $(ProductCards.CARDS_CLASS + ", " + ProductCards.TABBED_CARDS_CLASS).on('click', ProductCards.ADD_TO_CART_CLASS, ProductCards.handleAddToCart);
    },
    handleAddToCartModal: function () {
        var productUUID = $(this).attr(DATA_PRODUCT_ID);
        if (productUUID) {
            ProductCards.clearModal();
            var options = {
                id: productUUID,
            };
            $.when(ProductApi.getPackaging(options)).then(ProductCards.fillPackagingDetails, ProductCards.fillPackagingDetails);
        }
    },
    clearModal: function () {
        var packageContainer = $(".product-finder-package-container");
        packageContainer.empty();

        var handlebarsTemplate = Utils.getHandlebarsTemplate(ID_PRODUCT_FINDER_PRICING_LOADING_HANDLEBARS);
        packageContainer.append(handlebarsTemplate());
    },
    fillPackagingDetails: function (data) {
        var packageContainer = $(".product-finder-package-container");
        packageContainer.empty();

        if (data && data.total && data.total > 0) {
            var handlebarsTemplate = Utils.getHandlebarsTemplate(ID_PRODUCT_FINDER_PRICING_HANDLEBARS);
            if (handlebarsTemplate) {
                data.data.forEach(function (packageItem) {
                    packageContainer.append(handlebarsTemplate(packageItem));
                });
            }
        } else {
            var handlebarsTemplate = Utils.getHandlebarsTemplate(ID_PRODUCT_FINDER_PRICING_EMPTY_HANDLEBARS);
            packageContainer.append(handlebarsTemplate());
        }
    },
    handleAddToCart: function () {
        var callJson = ProductDetail.getCallData($(this));
        ProductApi.postAddToCart(callJson, ProductDetail.resetQuantities, function () {
        });
    }
};


$(ProductCards.init());

