var DATA_PRODUCT_ID = "data-product-id";
var DATA_MATERIAL_NR = "data-sku";
var PRODUCT_PACKAGING_ENDPOINT = "/rest/product/packaging";
var PRODUCT_PROMOTIONS_ENDPOINT = "/rest/promotions";
var PRODUCT_BY_SKU_ENDPOINT = "/rest/product/bySku";
var PRODUCT_OBSOLETE_ENDPOINT = "/rest/product/obsolete";
var BASKET_ADD_ENDPOINT = "/rest/basket/items";
var ID_PRODUCT_PRICING_HANDLEBARS = "#product-detail-prices-template";
var ID_PRODUCT_FINDER_PRICING_HANDLEBARS = "#product-packaging-item-modal-template";
var ID_PRODUCT_FINDER_PRICING_EMPTY_HANDLEBARS = "#product-packaging-item-modal-empty-template";
var ID_PRODUCT_FINDER_PRICING_LOADING_HANDLEBARS = "#product-packaging-item-modal-loading-template";
var PRODUCT_ITEMS_CONTAINER = ".product-details";
var VARIATION_SWITCH_LINK = ".product-detail-sku";
var ADD_TO_BASKET_BUTTON = ".basket-prices .add-to-basket";
var PRICE_CONTAINER = ".price-container";
var INPUT_QUANTITY = "input.input-number";

var ProductDetail = {
    appendLabel: function(product, injection, dynamic) {
        if (!product || !product.promoCode || (!dynamic && (!product.shortPromoText || !product.longPromoText))) {
            return;
        }
        var label = $("<button></button>");

        label.html(product.promoCode);
        label.attr("class", 'badge badge-promo btn');

        if (dynamic) {
            label.attr("data-toggle", "popover");
            label.attr("data-container", "body");
            label.attr("data-placement", "top");
            label.attr("title", product.shortPromoText);
            label.attr("data-content", product.longPromoText);
        }

        if (injection.find("> .badge.badge-promo").length) {
            injection.find("> .badge.badge-promo").remove();
        }
        injection.append(label);

        if (dynamic) {
            injection.find("> .badge.badge-promo").popover({
                trigger: "focus"
            });
        }
    },
    fetchPackagingDetails: function (element) {
         if (element) {
             var productUUID = element.attr(DATA_PRODUCT_ID);
             if (productUUID) {
                 var options = {
                     id: productUUID,
                 };
                 $.when(ProductApi.getPackaging(options)).then(ProductDetail.fillPackagingDetails);
             }
         }
     },
    // Special behaviour for logged out users
     checkPackaging: function(element) {
          var language = $('body[data-language]').attr('data-language');
          var lenght = $(PRODUCT_ITEMS_CONTAINER + " ul > li > a[data-sku]").length;

          $(PRODUCT_ITEMS_CONTAINER + " ul > li > a[data-sku], " + PRODUCT_ITEMS_CONTAINER + " ul[data-sku]").each(function() {
              var sku = $(this).attr("data-sku");

              ProductApi.checkObsolete(sku, language).done(function(data) {
                  var injectionPoint = $(PRODUCT_ITEMS_CONTAINER).find(".tab-content [data-sku='" + sku + "']").first();

                  if (injectionPoint.length > 0 && injectionPoint.get(0).tagName.toLowerCase() === "ul") {
                      injectionPoint = injectionPoint.parent();
                  }

                  if (injectionPoint.length > 0) {
                      if (!data.data.isObsolete) {
                          if (lenght > 1) {
                              injectionPoint.closest(".tab-pane").find(".obsolete-sku-alert").attr("style", "display: none !important");
                          } else {
                              injectionPoint.closest(".tab-content").find(".obsolete-sku-alert").attr("style", "display: none !important");
                          }
                      } else {
                          if (lenght > 1) {
                              injectionPoint.closest(".tab-pane").find(".obsolete-sku-alert").attr("style", "display: block !important");
                              injectionPoint.closest(".tab-pane").find(".authorization-message").attr("style", "display: none !important");
                          } else {
                              injectionPoint.closest(".tab-content").find(".obsolete-sku-alert").attr("style", "display: block !important");
                              injectionPoint.closest(".tab-content").find(".authorization-message").attr("style", "display: none !important");
                          }
                      }
                  }
              });
          });
     },
     submitCart: function () {
         var callJson = ProductDetail.getCallData($(this));

         if (callJson.length == 0) {
             return ProductDetail.resetQuantities(true);
         }

         ProductApi.postAddToCart(callJson, ProductDetail.resetQuantities, function () {});
     },
     resetQuantities: function (failed) {
         $(INPUT_QUANTITY).val(1);
         $('.modal').modal('hide');
         if (!failed) {
             $('#product-added-modal').modal();
         }
     },
     fillPackagingDetails: function (data) {
         if (data && data.data && data.total) {
             var handlebarsTemplate = Utils.getHandlebarsTemplate(ID_PRODUCT_PRICING_HANDLEBARS);
             if (handlebarsTemplate) {
                 var productNotObsolete = false;
                 data.data.forEach(function(e) {
                     if (!e.isObsolete) {
                         productNotObsolete = true;
                     }
                 });

                 if (!productNotObsolete) {
                     $(".obsolete-product-alert").attr("style", "display: block !important");
                 } else {
                     $(".obsolete-product-alert").attr("style", "display: none !important")
                 }

                 var multiple = false;

                 var skus = $.makeArray($(PRODUCT_ITEMS_CONTAINER).find("[data-sku]").map(function(i, e) {
                     return $(e).attr("data-sku");
                 }));


                 var sku;
                 for (var i = 0; i < skus.length; i++) {
                     if (skus[i]) {
                         if (!sku) {
                             sku = skus[i];
                         } else if (skus[i] !== sku) {
                             multiple = true;
                             break;
                         }
                     }
                 }

                 data.data.forEach(function (packageItem) {
                     var injectionPoint = $(PRODUCT_ITEMS_CONTAINER).find(".tab-content [data-sku='" + packageItem.materialNumber + "']").first();

                     if (injectionPoint.length > 0 && injectionPoint.get(0).tagName.toLowerCase() === "ul") {
                         injectionPoint = injectionPoint.parent();
                     }

                     if (multiple) {
                         ProductDetail.appendLabel(packageItem, $(PRODUCT_ITEMS_CONTAINER)
                             .find("[data-sku='" + packageItem.materialNumber + "'] .absolute-promotion-container"));
                     } else {
                         ProductDetail.appendLabel(packageItem, $(PRODUCT_ITEMS_CONTAINER).find(".promotion-container"));
                     }

                     if (injectionPoint.length > 0) {
                         if (!packageItem.isObsolete){
                             if (MyPuratosACL.roles[MyPuratosACL.RoleMatrix.puratosCustomerValidated]) {
                                 if (injectionPoint.find(".basket-prices")) {
                                     injectionPoint.find(".basket-prices").remove();
                                 }
                                 if (injectionPoint.find(".my-product-promotion-alert")) {
                                     injectionPoint.find(".my-product-promotion-alert").remove();
                                 }
                                 injectionPoint.append(handlebarsTemplate(packageItem));
                             }

                             if (multiple) {
                                 injectionPoint.closest(".tab-pane").find(".obsolete-sku-alert").attr("style", "display: none !important");
                             } else {
                                 injectionPoint.closest(".tab-content").find(".obsolete-sku-alert").attr("style", "display: none !important");
                             }
                         } else {
                             if (multiple) {
                                 injectionPoint.closest(".tab-pane").find(".obsolete-sku-alert").attr("style", "display: block !important");
                                 injectionPoint.closest(".tab-pane").find(".authorization-message").attr("style", "display: none !important");
                             } else {
                                 injectionPoint.closest(".tab-content").find(".obsolete-sku-alert").attr("style", "display: block !important");
                                 injectionPoint.closest(".tab-content").find(".authorization-message").attr("style", "display: none !important");
                             }
                         }
                     }
                 });
             }
         }
     },
    /**
     * Will create a JSON object that is required to make the addToBasketCall.
     * @param $element The submit button of the prices component
     * @return array Array with JSON object containing material number and quantity
     */
    getCallData: function ($element) {
        var list = [];
        var json = {};
        if ($element) {
            var priceParent = $element.parents(PRICE_CONTAINER);
            if (priceParent) {
                json.materialNumber = priceParent.attr(DATA_MATERIAL_NR);
                json.quantity = priceParent.find(INPUT_QUANTITY).val();
            }

            if (json.materialNumber && json.quantity > 0) {
                list.push(json);
            }

            return list;
        }
    },
    matchImage: function (materialNumber) {
        if (materialNumber) {
            var thumbnail = $('.p-slick__thumb[data-sku="' + materialNumber + '"]');
            if (thumbnail.length) {
                var slickIndex;
                if (thumbnail.attr("data-slick-index")) {
                    slickIndex = thumbnail.attr("data-slick-index");
                } else {
                    var ancestor = thumbnail.closest("[data-slick-index]");

                    if (ancestor.length) {
                        slickIndex = ancestor.attr("data-slick-index");
                    }
                }

                if (slickIndex || slickIndex === "0") {
                    $('.carousel-overview .p-slick').slick("slickGoTo", parseInt(slickIndex))
                }
            }
        }
    }
};


var ProductApi = {
    getPackaging: function (queryOptions) {
        return $.ajax({
            url: PRODUCT_PACKAGING_ENDPOINT + "?" + $.param(queryOptions),
            type: 'GET',
            xhrFields: {
                withCredentials: true,
            }
        });
    },
    getPromotions: function () {
        return $.ajax({
            url: PRODUCT_PROMOTIONS_ENDPOINT + "/?language=" + $("body").attr("data-language"),
            type: 'GET',
            xhrFields: {
                withCredentials: true,
            }
        });
    },
    getProductsBySKUS: function (skus) {
        return $.ajax({
            url: PRODUCT_BY_SKU_ENDPOINT + "?" + $.param({skus: skus}),
            type: 'GET',
            xhrFields: {
                withCredentials: true,
            }
        });
    },
    checkObsolete: function(sku, language) {
        return $.ajax({
            url: PRODUCT_OBSOLETE_ENDPOINT + "?" + $.param({sku: sku, lang: language}),
            type: 'GET',
            xhrFields: {
                withCredentials: true,
            }
        });
    },
    postAddToCart: function (jsonBody, successCallback, failCallback) {
        return $.ajax({
            url: BASKET_ADD_ENDPOINT,
            type: 'POST',
            data: JSON.stringify(jsonBody),
            xhrFields: {
                withCredentials: true,
            }
        }).done(function () {
            document.dispatchEvent(new CustomEvent('cart:update', {bubbles: true, cancelable: true}));
            successCallback();
        }).fail(function () {
            failCallback();
        });
    }

};

