const Utils = new Util();

function Util() {

    this.getUrlParameter = function (sParam) {
        const sPageURL = window.location.search.substring(1);
        const sURLVariables = sPageURL.split('&');
        for (let i = 0; i < sURLVariables.length; i++) {
            const sParameterName = sURLVariables[i].split('=');
            if (sParameterName[0] == sParam) {
                return decodeURIComponent(sParameterName[1]);
            }
        }
        return null;
    };

    this.containsUrlParameter = function (sParam) {
        const sPageURL = window.location.search.substring(1);
        const sURLVariables = sPageURL.split('&');
        for (let i = 0; i < sURLVariables.length; i++) {
            const sParameterName = sURLVariables[i].split('=');
            if (sParameterName[0] == sParam) {
                return true
            }
        }
        return false;
    };

    this.urlify = function (url, params, isWebservice) {
        let result = url;

        if (isWebservice === undefined || isWebservice === false) {

            if (result.slice(-1) != '?') {
                result = result + '?';
            }

            for (key in params) {
                if (params[key] != undefined) {
                    result += encodeURIComponent(key) + '='
                        + encodeURIComponent(params[key]) + '&';
                }
            }

            result = result.slice(0, -1);
        } else {

            if (result.slice(-1) == '/') {
                result = result.slice(0, -1);
            }

            for (key in params) {
                if (params[key] != undefined) {
                    result += '/' + encodeURIComponent(params[key]);
                }
            }

        }

        return result;
    };

    this.adjustUrl = function (title, url) {
        const timestamp = Date.now();
        history.pushState(timestamp, title, url);
    };

    this.localizeDates = function () {
        const toReplace = $("[data-moment-date]");
        $.each(toReplace, function () {
            const timestamp = $(this).attr("data-moment-date");
            const locale = $(this).attr("data-momemt-lang");
            moment.locales()?.includes(locale) ? moment.locale(locale) : moment.locale(locale.substring(locale.length - 2));
            if (timestamp && timestamp.length > 0) {
                $(this).text(moment(parseInt(timestamp)).format('LL'));
            }

        });
    };

    this.localizeDay = function () {
        const toReplace = $("[data-moment-day]");
        $.each(toReplace, function () {
            const timestamp = $(this).attr("data-moment-day");
            const locale = $(this).attr("data-moment-lang");
            moment.locales()?.includes(locale) ? moment.locale(locale) : moment.locale(locale.substring(locale.length - 2));
            if (timestamp && timestamp.length > 0) {
                $(this).innerHTML(moment(parseInt(timestamp)).format('Do'));
            }
        });
    };

    this.getHandlebarsTemplate = function (id) {
        const templateSource = $(id).html();
        if (templateSource) {
            return Handlebars.compile(templateSource);
        }
    };

}

