$(document).ready(function () {
    const modal = $('.modal');

    modal.on('shown.bs.modal', function (e) {
        // Handeling of DAM video (resume playing where stopped)
        if ($(this).find('.js-video-list').length > 0) {
            $(this).find('.js-video-list').get(0).play();
        }
    });

    modal.on('hidden.bs.modal', function (e) {
        // Handeling of DAM video
        if ($(this).find('.js-video-list').length > 0) {
            $(this).find('.js-video-list').get(0).pause();
        }

        $("#VideoID, .iframe__external-video").each(function () {
            const $this = $(this);
            const video = $this.attr("data-src");

            $this.attr("src", "");
            $this.attr("src", video);
        });
    })
});

