$(document).ready(function () {
    $('.video-videoplayer').parent().click(function () {
        if ($(this).children(".video-videoplayer").get(0).paused) {
            $(this).children(".video-videoplayer").get(0).play();
            $(this).children(".js-play-video").fadeOut();
        } else {
            $(this).children(".video-videoplayer").get(0).pause();
            $(this).children(".js-play-video").fadeIn();
        }
    });
    if ($('.video-videoplayer').length) {
        if ($('.video-videoplayer').get(0).autoplay) {
            $('.video-wrapper').children(".js-play-video").fadeOut();
        } else {
            $('.video-wrapper').children(".js-play-video").fadeIn();
        }
    }
});

