$(function() {
    var tileSquare = $(document).find("div.tile-square-text-box-slick");
    if(tileSquare){
        var jsSlick = tileSquare.find(".js-slick");

        if (jsSlick && typeof jsSlick.slick === 'function') {
            jsSlick.slick("unslick");
            if (window.innerWidth >= '1200') {
                $('.tile-square-text-box-text').matchHeight({ byRow: false });
                $('.tile-square-text-box-card').matchHeight({ byRow: false });
            }
            $.fn.matchHeight._afterUpdate = function(event, groups) {
                // do something after all updates are applied
                var innerSlick = $(document).find("div.tile-square-text-box-slick");
                if (innerSlick) {
                    var innerJsSlick = innerSlick.find(".js-slick");
                    if (innerJsSlick && typeof innerJsSlick.slick === 'function') {
                        innerJsSlick.slick();
                    }
                }
            };
        }


    }
});

