/**
 * Created by niels on 5/10/17.
 * Taste Tomorrow Feed component JS
 */
var tasteTomorrow = {
    RSS_FEED_URL: "//www.tastetomorrow.com/rss/index.php",
    init: function () {
        var tasteTomorrowResultComponents = $(".js-taste-tomorrow-results");

        if (tasteTomorrowResultComponents) {
            $(tasteTomorrowResultComponents).each(function (index, component) {
                tasteTomorrow.fetchFeed(component);
            });
        }
    },
    fetchFeed: function (component) {
        // Get Jobs JSON data
        $.ajax({
            url: tasteTomorrow.RSS_FEED_URL,
            dataType: "xml",
            type: "GET",
            success: function (xmlData) {
                var xmlFeedObject = tasteTomorrow.xmlToObject(xmlData);
                tasteTomorrow.renderFeed(component, xmlFeedObject);
            }
        });
    },
    xmlToObject: function (xmlDocument) {
        var feedItems = [];

        if (xmlDocument) {
            $(xmlDocument).find("item").each(function () {
                var xmlObject = {};

                var titleElement = $(this).find('title');
                if (titleElement && titleElement.length > 0) {
                    xmlObject.title = titleElement.first().text();
                }

                var descriptionElement = $(this).find('description');
                if (descriptionElement && descriptionElement.length > 0) {
                    xmlObject.description = descriptionElement.first().text();
                    if (xmlObject && xmlObject.description.length > 130) {
                        xmlObject.description = xmlObject.description.substring(0, 130) + "...";
                    }
                }

                var linkElement = $(this).find('link');
                if (linkElement && linkElement.length > 0) {
                    xmlObject.link = linkElement.first().text();
                }

                var tagElements = $(this).find('category');
                if (tagElements && tagElements.length > 0) {
                    var tagArray = [];
                    $(tagElements).each(function () {
                        tagArray.push($(this).text());
                    });
                    xmlObject.tags = tagArray.join(', ');
                }

                var imageElement = $(this).find('enclosure');
                if (imageElement && imageElement.length > 0) {
                    xmlObject.image = imageElement.first().attr("url");
                }

                feedItems.push(xmlObject);
            });
        }

        return feedItems;
    },
    renderFeed: function (component, xmlDocument) {

        $(component).empty();
        var templateSource = $("#taste-tomorrow-template").html();

        if (templateSource && xmlDocument) {
            var template = Handlebars.compile(templateSource);
            for (var i = 0; i < xmlDocument.length && i < 11; i++) {
                var feedItem = xmlDocument[i];
                $(component).append(template(feedItem));
            }
            $('.taste-tomorrow-slick').each(function () {
                //$(this).slick('unslick');
                $(this).slick({
                    slidesToShow: 4,
                    slidesToScroll: 4,
                    appendArrows: $(this).parent().find('.js-slick-nav'),
                    responsive: [{
                        breakpoint: 1200,
                        settings: {
                            slidesToShow: 3,
                            slidesToScroll: 3
                        }
                    }, {
                        breakpoint: 760,
                        settings: {
                            slidesToShow: 2,
                            slidesToScroll: 2
                        }
                    }, {
                        breakpoint: 600,
                        settings: {
                            slidesToShow: 1,
                            slidesToScroll: 1
                        }
                    }]
                });
                $.fn.matchHeight._applyDataApi();
            });
        }
    }
};
$(document).ready(function () {
    var tasteTomorrowFeed = $('.taste-tomorrow-feed');
    if (tasteTomorrowFeed && tasteTomorrowFeed.length > 0) {
        tasteTomorrow.init();
    }
});

