/**
 * Created by niels on 5/10/17.
 * Table component JS
 */
var table = {
    tableOptions: {
        tableClasses: "table table-condensed table-bare p-margin-bottom-none",
        tableTextClass: "p-table-text",
        tableAttrsToRemove: "width cellspacing cellpadding border"
    },
    init: function () {
        var tableComponents = $(".js-table");

        if (tableComponents && tableComponents.length) {
            $(tableComponents).each(function (index, component) {
                table.renderTable(component);
            });
        }
    },
    renderTable: function (component, data) {
        $(component).find('table').addClass(table.tableOptions.tableClasses).removeAttr(table.tableOptions.tableAttrsToRemove);
        $(component).find('tr').each(function () {
            $(this).find('td').addClass(table.tableOptions.tableTextClass);
            var firstColumn = $(this).find('td:first');
            if (firstColumn && firstColumn.length) {
                var tableCellContent = firstColumn.text();
                firstColumn.replaceWith($('<th>').addClass(table.tableOptions.tableTextClass).append(tableCellContent));
            }
        });

        $(component).show();
    }

};
$(document).ready(function () {
    var tableComponents = $('.js-table');
    if (tableComponents && tableComponents.length > 0) {
        table.init();
    }
});

