$(function() {
    var templates = {};

    $(document).on("click", "[data-video-player]", function() {
        var template = $(this).attr("data-video-player");
        var video = $(this).data("embed-video");

        if (!video && $(this).attr("data-video-player")) {
            video = JSON.parse($(this).attr("data-video-player"));
        }

        if (!video || !template) {
            return;
        }

        if (video.views && typeof video.views.toLocaleString == "function") {
            video.views = video.views.toLocaleString();
        }

        function doRender() {
            if (!templates[template]) return;

            var handlebar = Handlebars.compile(templates[template]);

            var $response = $(templates[template]);
            var allowed = $response.attr("data-allowed-tags");

            var tags = video.tags;

            if (allowed) {
                allowed = allowed.split(",").filter(function(v) { return v });

                tags = tags.filter(function(tag) {
                    for (var i = 0; i < allowed.length; i++) {
                        if (tag.id.indexOf(allowed[i]) === 0) {
                            return true;
                        }
                    }
                    return false;
                });
            }

            tags = tags.map(function(tag) { return (tag.title || tag); });

            var $modal = $(handlebar({ video: video, tags: tags })).appendTo($("body"));
            $modal.on("click", function() {
                $(this).modal("hide");
            });
            $modal.on("click", ".p-modal__close", function() {
                $modal.modal("hide");
            });

            $modal.on("show.bs.modal", function () {
                $("body").addClass("modal-open");
            }).on("hide.bs.modal", function () {
                $("body").removeClass("modal-open");

                $modal.remove();
            });

            $modal.find(".modal-content > *:not(.close)").on("click", function(e) {
                e.stopPropagation();
            });
            $modal.modal("show");
        }

        if (!templates[template]) {
            var target = template + ".html";

            if (window.location.pathname.endsWith(".html")) {
                target += "?wcmmode=disabled"
            }

            $.get(target, function(response) {
                templates[template] = response;
                doRender();
            });
        } else {
            doRender();
        }
    })
});

