$(function () {
    const o = (function ($target) {
        let c = {};
        const $form = $target.find(".hero-banner__form");

        let selectedTags = [];
        let selectedPeriod;

        c.initialize = function () {
            $form.find(".input-holder").each(function() {
                if ($(this).find("input").val()) {
                    $(this).find(".input-holder__label").fadeOut(0);
                }
            });

            const first = $($form.find(".input-holder:visible").get(0));

            if (first.length !== 0) {
                first.addClass("first");
            }

            c.initializeCategoryForm();
            c.initializeDateForm();
            c.initializeKeywordForm();

            $form.find(".btn.form-control").click(function() {
                $form.submit();
            });

            $form.on("submit", function(e) {
                e.preventDefault();

                let args = [];

                if (selectedTags) {
                    args.push({
                        "key": "tags",
                        "val": selectedTags.map(function(selectedTag) {
                            if (!selectedTag) return "";
                            else return selectedTag.id;
                        })
                    });
                }

                const $keyword = $form.find("[data-form='keyword'] input");
                if ($keyword && $keyword.val()) {
                    args.push({
                        "key": "search",
                        "val": [$keyword.val()]
                    })
                }

                const $date = $form.find("[data-form='date'] input");
                if ($date && $date.val() && selectedPeriod) {
                    args.push({
                        "key": "since",
                        "val": selectedPeriod.since
                    });
                    args.push({
                        "key": "to",
                        "val": selectedPeriod.to
                    });
                }

                const params = args.map(function(arg) {
                    if (Array.isArray(arg.val)) {
                        return arg.val.map(function(i) { return arg.key + "[]=" + i; }).join("&");
                    } else {
                        return arg.key + "=" + arg.val
                    }
                }).join("&");

                window.location = $form.attr("action") + "?" + params;
            });
        };

        c.initializeKeywordForm = function() {
            $form.find(".input-holder[data-form='keyword']").each(function() {
                const $holder = $(this);
                const $input = $holder.find("input");
                const labels = $holder.find(".input-holder__label");

                $input.focus(function() {
                    labels.fadeOut(50);
                });

                $input.blur(function() {
                    if (!$input.val()) {
                        labels.fadeIn(50);
                    }
                });
            });
        };

        c.initializeCategoryForm = function() {
            $form.find("[data-form='category']").each(function(index) {
                const $holder = $(this);
                const $input = $holder.find("input");
                const labels = $holder.find(".input-holder__label");
                const $select = $holder.find(".virtual-select-target");

                $input.keydown(function(e) {
                    if (e.key === "Delete" || e.key === "Backspace") {
                        selectedTags[index] = undefined;
                        $input.val("");
                        labels.fadeOut(50);
                        $holder.removeClass("open");
                        $select.find("div").removeClass("active");
                    }
                    e.preventDefault();
                    return false;
                });

                $input.focus(function() {
                    $holder.addClass("open");
                    $select.fadeIn(50);
                });

                $input.on("mousedown", function(e) {
                    if ($holder.hasClass("open")) {
                        e.preventDefault();
                        $holder.removeClass("open");
                        $select.fadeOut(50);
                        if (!$input.val()) {
                            labels.fadeIn(50);
                        }
                    }
                });

                $('body').click(function(e) {
                    if ($(e.target).closest('.input-holder').length === 0) {
                        $select.fadeOut(50);
                        $holder.removeClass("open");
                        if (!$input.val()) {
                            labels.fadeIn(50);
                        }
                    }
                });

                $select.on('click', 'div', function(e) {
                    e.preventDefault();
                    if ($(this).hasClass("active")) {
                        $(this).removeClass("active");
                        $holder.removeClass("open");
                        selectedTags[index] = undefined;
                        $input.val("");
                        $select.fadeOut(50);
                        labels.fadeIn(50);
                    } else {
                        $select.find("div").removeClass("active");
                        $(this).addClass("active");
                        $holder.removeClass("open");
                        selectedTags[index] = {
                            id: $(this).attr("data-value"),
                            title: $.trim($(this).text())
                        };
                        $input.val(selectedTags[index].title);
                        $select.fadeOut(50);
                        labels.fadeOut(50);
                    }
                });

                $input.change(function() {
                    if (!$input.val()) {
                        labels.fadeIn(50);
                    } else {
                        labels.fadeOut(50);
                    }
                });
            });
        };

        c.initializeDateForm = function() {
            $form.find(".input-holder[data-form='date']").each(function() {
                const $holder = $(this);
                const $input = $holder.find("input");
                const labels = $holder.find(".input-holder__label");
                const $select = $holder.find(".virtual-select-target");

                $input.keydown(function(e) {
                    if (e.key === "Delete" || e.key === "Backspace") {
                        selectedTag = undefined;
                        $input.val("");
                        labels.fadeOut(50);
                        $holder.removeClass("open");
                        $select.find("div").removeClass("active");
                    }
                    e.preventDefault();
                    return false;
                });

                $input.focus(function() {
                    $holder.addClass("open");
                    $select.fadeIn(50);
                });

                $input.on("mousedown", function(e) {
                    if ($holder.hasClass("open")) {
                        e.preventDefault();
                        $holder.removeClass("open");
                        $select.fadeOut(50);
                        if (!$input.val()) {
                            labels.fadeIn(50);
                        }
                    }
                });

                $('body').click(function(e) {
                    if ($(e.target).closest('.input-holder').length === 0) {
                        $select.fadeOut(50);
                        $holder.removeClass("open");
                        if (!$input.val()) {
                            labels.fadeIn(50);
                        }
                    }
                });

                $select.on('click', 'div', function(e) {
                    e.preventDefault();
                    if ($(this).hasClass("active")) {
                        $holder.removeClass("open");
                        $(this).removeClass("active");
                        selectedPeriod = undefined;
                        $input.val("");
                        $select.fadeOut(50);
                        labels.fadeIn(50);
                    } else {
                        $select.find("div").removeClass("active");
                        $holder.removeClass("open");
                        $(this).addClass("active");
                        selectedPeriod = {
                            title: $(this).text().trim(),
                            since: $(this).attr("data-since"),
                            to: $(this).attr("data-to")
                        };
                        $input.val(selectedPeriod.title);
                        $select.fadeOut(50);
                        labels.fadeOut(50);
                    }
                });

                $input.change(function() {
                    if (!$input.val()) {
                        labels.fadeIn(50);
                    } else {
                        labels.fadeOut(50);
                    }
                });
            });
        };

        c.initialize();
    });

    $(".puratos-tv-hero-banner").each(function () {
        (o($(this)));
    })

});



