var jobsLoadingTimer;
var allowedTags;

var newsOverview = {
    paginationDefaultOpts: {
        startPage: 1,
        totalPages: 1,
        visiblePages: 5,
        initiateStartPageClick: false,
        firstClass: "hidden",
        lastClass: "hidden",
        prevClass: "",
        nextClass: "",
        pageClass: "",
        anchorClass: "",
        activeClass: "active",
        disabledClass: "disabled"
    },
    init: function () {
        newsOverview.attachEventHandlers();

        var newsOverviewComponents = $(".js-news-overview");

        $(newsOverviewComponents).find(':checkbox').each(function () {
                $(this).parent().hide();
            }
        );

        if (newsOverviewComponents) {
            var tagArray = [];
            $('[data-tag-path]').each(function (e) {
                tagArray.push($(this).attr('data-tag-path'));
            });
            allowedTags = tagArray;

            $(newsOverviewComponents).each(function (index, component) {
                newsOverview.initPagination(component);
                newsOverview.searchNews(component);
            });
        }
    },
    loadURLParameters: function () {
        var component = $(".js-news-overview");

        var tags = Utils.getUrlParameter("tags");
        var tagArray = [];
        if (tags) {
            tagArray = tags.split(',');
        }
        var index = Utils.getUrlParameter("offset");

        var activeTags = component.find(".js-news-overview-filters").first();

        //set checkboxes
        for (var i = 0; i < tagArray.length; i++) {
            var tagPath = tagArray[i];
            var checkbox = $('[data-tag-path = "' + tagPath + '"]');
            var tagTitle = checkbox.attr('data-tag-title');
            checkbox.prop('checked', true);
        }

        var currentPageIndex = $(component).find('.js-news-overview-filters').first();
        if (index) {
            currentPageIndex.attr('data-offset', index)
        }
    },
    attachEventHandlers: function () {
        $(".js-news-overview-filters").on("change", "input[type='checkbox']", function (e) {

            var component = $(this).closest(".js-news-overview");
            var currentPageIndex = $(component).find('.js-news-overview-filters').first();
            currentPageIndex.removeAttr('data-offset'); // reset page index on new search

            newsOverview.searchNews(component);
        });
    },
    getParams: function (filters, type, root, limit, page, mediaResource) {
        var params = [];
        if (filters) {
            var tagPaths = [];

            filters.find("input[type='checkbox']:checked")
                .each(function (index) {
                        tagPaths.push($(this).attr('data-tag-path'));
                    }
                );

            if (tagPaths && tagPaths.length > 0) {
                params.push("tags=" + tagPaths.join());
            }
        }

        if (type) {
            params.push("type=" + type);
        }
        if (mediaResource) {
            prarams.push("mediaResource" + mediaResource);
        }
        if (root) {
            params.push("root=" + root);
        }

        if (limit) {
            params.push("limit=" + limit);
        }
        if (page) {
            params.push("offset=" + page);
        }

        return params;
    },
    replaceUrlParams: function (params) {
        if (window.history.pushState) {
            var newUrl = window.location.origin + window.location.pathname;
            if (params) {
                newUrl += "?";
                params.forEach(function (e) {
                    newUrl += (e + "&");
                });
                newUrl = newUrl.trim("&");
            }
            window.history.pushState("", "", newUrl);
        }
    },
    searchNews: function (component) {
        newsOverview.showLoadingStatus();

        var filters = $(component).find(".js-news-overview-filters").first();
        var limit = $(filters).attr("data-limit");
        var rootPath = $(filters).attr("data-root");
        var offset = $(filters).attr("data-offset");
        var params = newsOverview.getParams(filters, "news", rootPath, limit, offset);

        // Replace URL parameters in browser
        newsOverview.replaceUrlParams(params);

        // Construct JSON URL
        var jsonUrl = $(filters).attr("data-src") + ".news.json";
        if (params) {
            jsonUrl += "?";
            params.forEach(function (e) {
                jsonUrl += (e + "&");
            });
            jsonUrl = jsonUrl.trim("&");
        }

        // Get Jobs JSON data
        $.getJSON(jsonUrl, function (data, status) {
            var amountOfNews = data.resultCount;
            var pageSize = data.pageSize;
            var nextPageOffset = data.nextPageCursor;
            var previousPageOffset = data.previousPageCursor;
            var currentOffset = data.currentOffset;
            var amountOfPages = newsOverview.calculateTotalPages(amountOfNews, limit);

            // Render jobs in HTML
            newsOverview.renderNews(component, data);
            newsOverview.renderPagination(component, amountOfNews, amountOfPages, pageSize, nextPageOffset, previousPageOffset, currentOffset);

            newsOverview.hideUnusedTagFilters(component, data.presentTags);

            newsOverview.hideLoadingStatus();
            $.fn.matchHeight._applyDataApi()

        }).fail(function (jqxhr, textStatus, error) {
            var err = textStatus + ", " + error;
            console.log("News Overview JSON request to retrieve jobs failed: " + err);
        });
    },
    calculateTotalPages: function (amountOfItems, itemsPerPage) {
        var amountOfPages = Math.ceil(amountOfItems / itemsPerPage);
        return amountOfPages || 1;
    },
    renderNews: function (component, data) {
        $(component).find(".js-news-overview-results").empty();
        var templateSource = $("#news-overview-template").html();
        if (templateSource && data && data.pages && data.pages.length > 0) {
            var template = Handlebars.compile(templateSource);
            for (var i = 0; i < data.pages.length; i++) {
                var newsItem = data.pages[i];
                $(component).find(".js-news-overview-results").append(template(newsItem));
            }
        }

        /*Only display allowed tags*/
        var $newsTags = $(component).find('.js-news-tag');
        $newsTags.hide();
        if (allowedTags && allowedTags.length > 0) {
            $newsTags.each(function (e) {
                for (var i = 0; i < allowedTags.length; i++) {
                    if (allowedTags[i] === $(this).attr('data-tag-path')) {
                        $(this).show();
                    }
                }
            })
        }
    },
    renderPagination: function (component, amountOfNews, amountOfPages, pageSize, nextPageOffset, previousPageOffset, currentOffset) {
        var paginationList = $(component).find(".js-news-overview-pagination ul").first();
        var resultCount = $(component).find('.js-news-overview-resultcount').first();

        resultCount.text(amountOfNews);

        // Remove existing pagination
        paginationList.twbsPagination('destroy');

        if (amountOfNews > 0 && amountOfPages > 1) {
            var currentPage = 1;

            if (pageSize && currentOffset) {
                currentPage = (currentOffset / pageSize) + 1;
            }

            var newsFilters = $(component).find('.js-news-overview-filters').first();

            // Create new pagination (using 'twbsPagination' jQuery plugin)
            paginationList.twbsPagination($.extend({}, newsOverview.paginationDefaultOpts, {
                startPage: currentPage,
                totalPages: amountOfPages,
                onPageClick: function (event, pageNr) {
                    // Scroll to top of page
                    window.scrollTo(0, 0);

                    // Update index parameter in filters form
                    newsFilters.attr('data-offset', (pageNr - 1) * pageSize);

                    // Execute job search
                    newsOverview.searchNews(component);
                },
                prev: '&laquo;',
                next: '&raquo'
            }));
        }
    },
    initPagination: function (component) {
        const paginationList = $(component).find(".js-news-overview-pagination ul").first();
        const resultLabel = $(component).find('.js-news-overview-resultlabel').first();
        const resultCount = $(component).find('.js-news-overview-resultcount').first();

        if (resultLabel.text().includes('{0}')) {
            resultLabel.text(resultLabel.text().replace('{0}', ''));
            resultCount.removeClass('hidden');
        }

        paginationList.twbsPagination(newsOverview.paginationDefaultOpts);
    },
    showLoadingStatus: function () {
        jobsLoadingTimer && clearTimeout(jobsLoadingTimer);
        jobsLoadingTimer = setTimeout(function () {
            $(".js-jobs-overview-loading").removeClass("hidden");
        }, 200);
    },
    hideLoadingStatus: function () {
        clearTimeout(jobsLoadingTimer);
        $(".js-jobs-overview-loading").addClass("hidden");
    },
    hideUnusedTagFilters: function (component, presentTags) {
        /*PAM-85 Hide unused tags news*/
        $(component).find(':checkbox').each(function () {
                var tagPath = $(this).attr('data-tag-path');
                if ($.inArray(tagPath, presentTags) !== -1) {
                    $(this).parent().show();
                }
            }
        );
    }
};

