$(document).ready(function () {
    function selectTabOfPan(wrapper, index) {
        var container = $(wrapper.get(0));
        container.find('li.p-history-timeline-content__tab').each(function () {
            $(this).removeClass('active');
            $(this).children().eq(0).removeClass('active');
        });

        var activated = wrapper.find('li.p-history-timeline-content__tab').eq(index);
        activated.addClass('active');
        activated.children().eq(0).addClass('active');
    }

    function centerPan(wrapper) {
        var elemSlider = wrapper.find('ul.p-history-timeline-list-nav-horizontal'),
            elemFirstSlider = elemSlider.find('li.p-history-timeline-content__tab')[0],
            elemActiveSlider = elemSlider.find('li.p-history-timeline-content__tab.active')[0];

        if (elemFirstSlider === undefined || elemActiveSlider === undefined) {
            return;
        }

        var sliderOffset = elemActiveSlider.offsetLeft - (elemSlider[0].offsetWidth / 2) - elemFirstSlider.offsetLeft + (elemActiveSlider.offsetWidth / 2);
        elemSlider.animate({scrollLeft: sliderOffset}, 350);
    }

    $('.history-timeline-container .slick-next.slick-arrow, .history-timeline-container .slick-prev.slick-arrow, .history-timeline-container .p-history-timeline-item-nav').click(function () {
        var activeElem = $('.slick-slide.slick-current.slick-active'),
            wrapper = activeElem.closest('.history-timeline-wrapper'),
            index = activeElem.attr('data-slick-index');

        if (wrapper.length === 0 || index === undefined) {
            return;
        }

        selectTabOfPan(wrapper, index);
        centerPan(wrapper);
    });
});


