$(document).ready(function () {
    $(".category-list-answers-item").show();

    $(".faq-sublist").contents().unwrap();
    $(".category-list-answers-itemgroup").contents().unwrap();

    $(".faq-list-item").click(function () {
        if ($(this).hasClass('active')) {
            $(".category-list-answers-item").addClass("visible").show();
            $('.faq-list-item').removeClass("active");
            $('input[type=checkbox]').prop('checked', false);
        }
        else {
            var hashcode = this.getAttribute("data-hash");
            if (hashcode) {
                $(".category-list-answers-item").removeClass("visible").hide();
                $('.category-list-answers-item-' + hashcode).addClass("visible").show();
                $('.faq-list-item').removeClass("active");
                $(this).addClass("active");
                $('input[type=checkbox]').prop('checked', false);
            }
        }
        var questions = $(".category-list-answers-item");
        if ($(questions).length > 15) {
            for (var i = 0; i < $(questions).length; i++) {
                if (i >= 15) {
                    $($(questions)[i]).hide();
                }
            }
        }
        generatePagination();
        updateIndex(1);
    });

    function generatePagination() {
        var visibleItems = $(".category-list-answers-item.visible");
        var numberOfPages = Math.ceil($(visibleItems).length / 15);

        if (numberOfPages > 0) {
            $(".js-pagination-faq-page").remove();
            for (var i = numberOfPages; i > 0; i--) {
                if (i == 1) {
                    $(".js-pagination-faq-previous-page").after("<li class='js-pagination-faq-page active'><a href='#'>" + (i) + "</a></li>");
                } else {
                    $(".js-pagination-faq-previous-page").after("<li class='js-pagination-faq-page'><a href='#'>" + (i) + "</a></li>");
                }
            }
        }

        if ($(".js-pagination-faq-page").length <= 1) {
            $(".js-pagination-faq-previous-page").addClass("disabled");
            $(".js-pagination-faq-next-page").addClass("disabled");
        }
    }

    $(".js-pagination-faq").on("click", ".js-pagination-faq-page", function () {
        event.preventDefault();
        updatePagination($(this));
        updateIndex(Number($(this).text()));
    });

    $(".js-pagination-faq").on("click", ".js-pagination-faq-next-page", function (event) {
        event.preventDefault();
        if (!$(this).hasClass("disabled")) {
            var currentNumber = Number($(".js-pagination-faq-page.active").text());
            updatePagination($(".js-pagination-faq-page")[currentNumber]);
            updateIndex(currentNumber + 1);
            $(".js-pagination-faq-previous-page").removeClass("disabled");
        }
    });

    $(".js-pagination-faq").on("click", ".js-pagination-faq-previous-page", function (event) {
        event.preventDefault();
        if (!$(this).hasClass("disabled")) {
            var currentNumber = Number($(".js-pagination-faq-page.active").text());
            updatePagination($(".js-pagination-faq-page")[currentNumber - 2]);
            updateIndex(currentNumber - 1);
            $(".js-pagination-faq-next-page").removeClass("disabled");
        }
    });

    function updatePagination(numberSelected) {
        var pages = $(".js-pagination-faq-page");

        //Remove prev current number as active
        $(".js-pagination-faq-page.active").removeClass("active");
        $(numberSelected).addClass("active");

        //If we are in the first number
        if ($($(pages)[0]).text() == $(numberSelected).text()) {
            //Disable previous button
            $(".js-pagination-faq-previous-page").addClass("disabled");
            //If we are in the last number
        } else if ($($(pages)[$(pages).length - 1]).text() == $(numberSelected).text()) {
            //Disable next button
            $(".js-pagination-faq-next-page").addClass("disabled");
            //Otherwise both next and previous must be enabled
        } else {
            if ($(".js-pagination-faq-previous-page.disabled").length > 0) {
                $(".js-pagination-faq-previous-page").removeClass("disabled");
            }
            if ($(".js-pagination-faq-next-page.disabled").length > 0) {
                $(".js-pagination-faq-next-page").removeClass("disabled");
            }
        }

    }

    function updateIndex(index) {
        var visibleItems = $(".category-list-answers-item.visible");
        $(visibleItems).hide();

        for (var i = 0; i < 15; i++) {
            $($(visibleItems)[15 * (index - 1) + i]).show();
        }


        var buttons = $(".js-pagination-faq-page");
        if ($(buttons.length > 5)) {
            $(buttons).hide();

            if ($($(buttons)[0]).hasClass("active")
                || $($(buttons)[1]).hasClass("active")
                || $($(buttons)[2]).hasClass("active")) {
                for (var i = 0; i < 5; i++) {
                    $($(buttons)[i]).show();
                }
            } else if ($($(buttons)[$(buttons).length - 1]).hasClass("active")
                || $($(buttons)[$(buttons).length - 2]).hasClass("active")
                || $($(buttons)[$(buttons).length - 3]).hasClass("active")) {
                for (var i = $(buttons).length - 1; i > $(buttons).length - 5; i--) {
                    $($(buttons)[i]).show();
                }
            } else {
                var currentNumber = Number($(".js-pagination-faq-page.active").text());
                $($(buttons)[currentNumber - 2]).show();
                $($(buttons)[currentNumber - 3]).show();
                $($(buttons)[currentNumber - 1]).show();
                $($(buttons)[currentNumber]).show();
                $($(buttons)[currentNumber + 1]).show();
            }
        }
    }

    var questions = $(".category-list-answers-item");
    if ($(questions).length > 15) {
        for (var i = 0; i < $(questions).length; i++) {
            if (i >= 15) {
                $($(questions)[i]).hide();
            }
        }
    }
    generatePagination();
    updateIndex(1);

});

